  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) DEFAULT NULL,
  `name` varchar(50) DEFAULT NULL,
  `status` tinyint(1) unsigned DEFAULT '1',
  `deviceid` varchar(50) DEFAULT NULL,
  `activationkey` varchar(300) DEFAULT NULL,
  `created_at` int(11) unsigned DEFAULT NULL,
  `updated_at` int(11) unsigned DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `user_id_deviceid` (`user_id`,`deviceid`),
  KEY `user_devices_user_id_fk` (`user_id`),
  KEY `deviceid` (`deviceid`),
  CONSTRAINT `user_devices_user_id_fk` FOREIGN KEY (`user_id`) REFERENCES `user` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

